import React from 'react'

const Choice = props => {
  return (
    <div className="form-check card">
      <input
        className="form-check-input"
        type="radio"
        name="exampleRadios"
        value={props.value}
        checked
      />
      <p className="form-check-label response-text" for="exampleRadios1">
        {props.propValue}
      </p>
    </div>
  )
}

export default Choice
